import React, { useEffect } from 'react'

export default function Home() {

    useEffect(()=>{
        fetch('https://api.themoviedb.org/3/movie/550?api_key=7b7ae6b8eb96cbea3b6906128bdf23af')
        .then(res => res.json())
        .then(data => console.log(data.results))
    }, [])
  return (
    <div></div>
  )
}
